// src/routes.js
const routes = {
  SIGN_UP: "/sign-up",
  SIGN_IN: "/sign-in",
  DASHBOARD: "/dashboard",
  APARTMENTS: "/apartments",
  APARTMENT_DETAIL: "/apartments/:id",
  PRICING: "/pricing",
  USER_PAGE: "/user-page",
};

export default routes; // Esporto l'oggetto routes per l'uso in altre parti dell'app
